description:
Indycar's Round 13 had been postponed to Sunday morning due to pouring rain on track that avoided having a race. Safety Car spinning out of the track could show it to us. That's brazilian full coverage of Sunday morning's race in which Sebastian Bourdais was the winner.
To be honest, that wasn't a very exciting race, not much as the following race in the afternoon. That's why YOU SHOULD SEED it in case you download this file as I won't keep it on my pc for a long time. Brazilian Portuguese commentaries by Nivaldo Prieto and Sergio Ximenes. 


